import { Component } from "react";

export default class Textfield extends Component {
    render() {
        return (
            <table class="textfield">
                <tr>
                    <td>
                        <img src={this.props.icon} />
                    </td>
                    <td>
                        <input type="text" name={this.props.name} placeholder={this.props} />
                    </td>
                </tr>
            </table>
        );
    }
}
